INSERT INTO `cpm_goodssku` VALUES (2,'2019-09-06 15:08:13.359896','2019-09-09 10:59:08.719466',NULL,'001','1567997948.350368-19002-001.jpg','36','16','50','0.1',2,'长筒靴你真的穿对了吗？\n\n今年街拍有两种靴子特别常见，一种是往年也流行过的长筒靴，一种是2017年兴起的袜靴。\n\n首先我们先讲一讲长筒靴的穿搭：\n\n很多宝宝是害怕买或者不会买长筒靴，因为觉得说：“我觉得我的腿特别粗不适合穿长筒靴”，“我觉得个子矮不适合穿长筒靴”，其实我觉得这些并不是问题，最重要的是你的搭配是否让人觉得舒服亮眼。担心自己的腿粗不适合穿的宝宝最应该到实体店里尝试一下，合适的尺码的长筒靴尤其是黑色的长筒靴是能够起到显瘦的效果的。',18800,16800,38800,'黑色加绒','2019-11-11 00:00:00.000000',1,'30',0,365,''),(3,'2019-09-06 15:17:10.793991','2019-09-09 10:55:32.528262',NULL,'002','1567754230.815296-19002-002.jpg','36','20','50','1.6',2,'第三，不要买靴筒太松的款式，最后关于靴筒的样式，小个子的女生还是建议选择比较紧的靴筒，会让自己的腿部显得更细长一些，如果你选择靴筒太过宽松，而且靴子本身就有一定的长度，然后松垮的款式让靴筒都堆在了一起，看起来腿部会非常的短，而且显粗是肯定的。所以小个子的女生要选择紧一点的靴筒，如果太宽松出现掉筒的情况，看起来也会不利索，所以过膝长靴在挑选的时候还是要注意的！',19800,17800,39800,'黄色加绒','2019-11-11 00:00:00.000000',1,'30',0,1000,''),(6,'2019-09-11 10:45:14.134168','2019-09-11 10:45:14.666367',NULL,'001','1568169914.149557-19005-001.png','20','20','50','1',5,'拉菲红酒（Château Lafite-Rothschild），是指拉菲酒庄出品的红酒，法国波尔多五大名庄之一，历史悠久。拉菲酒花香、果香突出，芳醇柔顺，典雅，称为葡萄酒王国中的皇后。2014年3月26日法国总统奥朗德在爱丽舍宫为习近平和夫人彭丽媛举行了盛大国宴，前道菜就是佐1997年的吕萨吕斯酒堡葡萄酒，主菜配1...',3666600,0,0,'82年限定款','2019-12-12 00:00:00.000000',2,'30',0,999,''),(7,'2019-09-12 14:59:56.877688','2019-09-12 14:59:57.222191',NULL,'001','1568271596.897726-19006-001.jpeg','12','12','12','0.11',1,'手链是一种首饰，配戴在手腕部位，多为金银等金属制品，也有矿石、水晶等制的。手链是链状的，以祈求平安，镇定心志和美观为主要用途。',18800,0,0,'精品手链','2019-12-12 00:00:00.000000',1,'30',0,0,''),(8,'2019-09-12 15:04:22.616723','2019-09-23 16:09:42.221875',NULL,'002','1568272017.773154-19006-002.jpg','14','14','15','1.00',1,'银一向最衬那些气质清澈纯粹的女子,它的柔软洁白搭配水晶的光芒,总能在不经意中一闪而过,成为眸子中美丽的风景。红绳的意义大家都知道啦,又辟邪还很漂..',8800,0,0,'红神手链','2019-12-12 00:00:00.000000',88,'8',0,0,''),(9,'2019-09-12 15:08:37.822993','2019-09-12 15:08:39.644312',NULL,'003','1568272117.838193-19006-003.jpg','12','13','14','0.33',1,'水晶手链是一种现在流行饰品之一。佩戴天然水晶手链受灵性作用，可开运助财、经常佩带，有意想不到的效果。组成手链的水晶，不同品种代表不同的含义。',8988,0,0,'水晶手链','2019-12-12 00:00:00.000000',66,'',0,0,''),(10,'2019-09-12 17:27:45.792573','2019-09-12 17:30:05.386473',NULL,'001','1568280465.804914-19007-001.jpeg','30','25','3','0.085',8,'手绘青花瓷折叠镜,手绘艺术具有较高的观赏和收藏价值，可以说手绘是景德镇瓷器的特色，在国际上一直深受好评，而手绘茶具，是手绘艺术瓷中的新宠儿，小巧玲珑，各种绘画拼凑一起，相互寸',1888,0,2888,'水墨山水','2019-12-12 00:00:00.000000',10,'8',0,0,''),(11,'2019-09-16 16:57:01.655548','2019-10-17 14:28:47.700143',NULL,'001','1568624221.674266-19009-001.png','20','15','30','0.22',10,'该水杯用于测试图像搜索',888,0,1800,'玻璃水杯','2019-12-12 00:00:00.000000',20,'10',0,0,''),(18,'2019-09-23 08:59:38.974200','2019-09-23 09:00:39.500182',NULL,'001','1569200378.991038-1-001.jpeg','1','2','2','3',7,'',111,0,0,'毛绒熊','2019-12-12 00:00:00.000000',0,'',0,0,''),(19,'2019-09-23 11:27:51.558100','2019-09-23 11:27:53.563971',NULL,'001','1569209271.575059-19012-001.png','12','12','1','2',14,'这是描述',8888,0,0,'多功能瑞士军刀','2019-12-12 00:00:00.000000',0,'',0,0,''),(20,'2019-09-23 14:33:57.389155','2019-09-23 14:50:08.446109',NULL,'001','1569220437.400177-19013-001.jpg','18','2','2','0.01',11,'可爱猫咪中性笔可爱猫咪中性笔可爱猫咪中性笔可爱猫咪中性笔可爱猫咪中性笔',2,0,0,'一盒十只','2019-12-12 00:00:00.000000',0,'',0,0,''),(22,'2019-09-25 16:29:46.886967','2019-09-26 17:39:55.383826',NULL,'001','1569400186.894058-19017-001.jpg','20.8','14','1','0.249',16,'',330,415,800,'A5横线本','2019-01-01 00:00:00.000000',0,'',1,0,''),(23,'2019-09-25 17:37:01.715933','2019-09-26 17:39:55.514803',NULL,'002','1569404221.720372-19017-002.jpg','20.8','14','1','0.249',16,'',330,0,0,'A5空白本','2019-01-01 00:00:00.000000',0,'',1,0,''),(24,'2019-09-25 18:22:45.870406','2019-09-25 18:22:47.484933',NULL,'003','1569406965.885059-19014-003.jpg','60','12','60','0.12',2,'我是备注',13333,13211,18800,'新款长筒靴','2019-12-12 00:00:00.000000',10,'30',0,365,'111'),(31,'2019-09-25 19:53:34.776718','2019-09-25 19:53:36.719300',NULL,'004','1569412414.799267-19014-004.jpg','1','2','3','3',2,'description',500,0,800,'新款','2019-12-12 00:00:00.000000',8,'8',0,0,'8'),(32,'2019-09-25 19:54:04.986924','2019-09-29 14:51:02.349306',NULL,'005','1569412445.019021-19014-005.jpg','8','8','8','0.22',2,'',800,800,800,'新款2号','2019-12-12 00:00:00.000000',8,'8',0,0,''),(33,'2019-09-29 15:10:42.356739','2019-09-29 15:10:44.945232',NULL,'001','1569741042.384047-19018-001.jpg','16','12','16','0.01',17,'\n懒***飞（匿名）\n\n买了小号的袋子，装一瓶小护手霜正好，送人很好看，粉菠萝这个小袋子像帆布袋，材质比较厚实，图案还是漂亮的沒有拍照，粉柚的袋子和黄菠萝袋子布料没有粉菠萝袋子的布料粗，它们的布料是细细的，滑滑的，手感非常好。很不错的袋子，很喜欢，送小礼物装袋佳品，有需要会回购！\n',100,0,198,'乳白色 刺猬小号','2019-12-12 00:00:00.000000',0,'',0,0,''),(34,'2019-09-29 15:12:33.216590','2019-09-29 15:12:35.613973',NULL,'002','1569741153.232686-19018-002.jpg','18','18','18','0.02',17,'东西都很棒 是我想要的质量 日历的简约风真是爱了 笔筒也和图片上的一样 收纳带挺好的装袜子是足够用的了 鞋刷也很好毕竟颜色是我喜欢的 最棒的是那个浴花 摸着都很舒服呀 商家的包装都很好 没有磕碰的情况 总体来说 性价比很高❤️',100,0,198,'藕色 花纹款 小号','2019-12-12 00:00:00.000000',0,'',0,0,''),(35,'2019-10-08 15:21:48.002702','2019-10-08 15:21:51.414505',NULL,'001','1570519308.006457-19019-001.jpg','18.6','6','6.1','0.027',18,'',298,372,800,'方形-星星字母','2019-10-01 00:00:00.000000',0,'',0,0,''),(36,'2019-10-08 15:23:06.082193','2019-10-08 15:23:08.601200',NULL,'002','1570519386.085072-19019-002.jpg','18.6','6','6.1','0.027',18,'',298,372,800,'方形-爱心字母','2019-10-01 00:00:00.000000',0,'',0,0,''),(37,'2019-10-08 15:38:32.647849','2019-10-08 15:38:35.736320',NULL,'005','1570520312.65123-19019-005.jpg','18.6','3','6.1','0.027',18,'',229,287,700,'梯形-星星字母','2019-12-12 00:00:00.000000',0,'',0,0,''),(38,'2019-10-16 15:04:03.482532','2019-10-16 15:04:06.009155',NULL,'001','1571209443.49848-19015-001.jpeg','0','0','0','0',15,'无备注',22,0,33,'完整版','2019-12-12 00:00:00.000000',0,'',0,0,''),(39,'2019-10-21 15:35:53.898436','2019-10-21 15:35:56.049788',NULL,'001','1571643353.90222-19021-001.jpg','28','10','5','200',20,'',680,860,1680,'独角兽豆沙粉','2019-12-12 00:00:00.000000',0,'',0,0,''),(40,'2019-10-21 15:37:10.531514','2019-10-21 15:37:12.274763',NULL,'002','1571643430.534102-19021-002.jpg','28','10','5','200',20,'',680,860,1680,'黑色','2019-12-12 00:00:00.000000',0,'',0,0,''),(42,'2019-11-06 20:57:15.544069','2019-11-06 20:57:17.177063',NULL,'001','15